class themeMode {
  modeToggler() {
    jQuery("html").toggleClass("uk-light");
    jQuery("[data-theme-switcher]").toggleClass("darked");
  }

  modeManager() {
    if (localStorage.getItem("theme") === "dark") {
      this.modeToggler();
    }
  }

  // mode switcher
  modeSwitcher() {
    if (localStorage.getItem("theme") !== "dark") {
      localStorage.setItem("theme", "dark");
    } else {
      localStorage.removeItem("theme");
    }
    this.modeToggler();
  }
}
const theme = new themeMode();
theme.modeManager();
