// loader management
if (sessionStorage.getItem("cached") === null) {
  let audioElement = document.createElement('audio');
  audioElement.setAttribute("src", "/../media/audios/loading.mp3");
  audioElement.currentTime = 0;
  audioElement.play();
  document.getElementById("preloader").classList.add("show");
  var counting = setInterval(function () {
    var loader = document.getElementById("percentage");
    var currval = parseInt(loader.innerHTML);
    var Width = 99 - currval;
    var loadscreen = document.getElementById("loader-progress");
    loader.innerHTML = currval + Math.floor(Math.random() * 10);
    if (currval > 89) {
      loader.innerHTML = 90;
      if (window.jQuery) {
        //console.log('jquery loaded');
        loader.innerHTML = 95;
        if (document.readyState == "interactive") {
          loader.innerHTML = 99;
        }
        if (document.readyState == "complete") {
          //console.log('fully loaded!');
          clearInterval(counting);
          loader.innerHTML = 100;
          jQuery("body").toggleClass("page-loaded");
          setTimeout(function () {
            jQuery("nav").css("visibility", "visible");
          }, 880);
        }
      }
    }

    loadscreen.style.transition = "0.15s";
    loadscreen.style.width = Width + "%";
  }, 150);
}

//slick sliders
function slickSliders() {
  $(".slick-continues").slick({
    arrows: false,
    infinite: true,
    autoplay: true,
    autoplaySpeed: 0,
    speed: 8000,
    centerMode: true,
    variableWidth: true,
    pauseOnFocus: false,
    pauseOnHover: false,
    useCSS: false,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 3,
          slidesToScroll: 3,
        },
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 2,
        },
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
        },
      },
      // You can unslick at a given breakpoint now by adding:
      // settings: "unslick"
      // instead of a settings object
    ],
  });
}

function cloneMultiply(elem) {
  let html = ``;
  for (let index = 0; index < 8; index++) {
    html += elem.html();
  }
  elem.html(html);
}

// scroll to top
function detectScrollDirecton() {
  var lastScrollTop = 0;
  $(window).scroll(function (event) {
    var st = $(this).scrollTop();
    if (st > lastScrollTop) {
      // downscroll code
      $("body").removeClass("scrollToTop");
    } else {
      // upscroll code
      $("body").addClass("scrollToTop");
    }
    lastScrollTop = st;
  });
}

