// sounds 
let soundClickInteractions = (soundItems) => {
  soundItems.forEach((item, index) => {
    // reference : https://stackoverflow.com/questions/8489710/play-an-audio-file-using-jquery-when-a-button-is-clicked
    let url = item[0];
    let elem = item[1];
    let anime = item[2];
    let audioElement = document.createElement('audio');
    audioElement.setAttribute("src", url);

    $(elem).click(function () {
      audioElement.currentTime = 0;
      audioElement.play();
    });
    // if animation 
    if (anime) {
      $(elem).click(function () {
        $(elem).addClass(anime);
        setTimeout(()=>$(elem).removeClass(anime),300)
      });
    }
  })
}
let soundElements = () => {
  let soundItems = [[
    '/../media/audios/meow.mp3', ".uk-logo", "uk-animation-shake"
  ], [
    '/../media/audios/switcher.mp3', "[data-theme-switcher]", false
  ]];

  soundClickInteractions(soundItems);
}

let slideupAnime = ()=> {
  const txts=document.querySelector(".animate-text").children,
               txtsLen=txts.length;
           let index=0;
          const textInTimer=3000,
                textOutTimer=2800;

         function animateText() {
            for(let i=0; i<txtsLen; i++){
              txts[i].classList.remove("text-in","text-out");  
            }
            txts[index].classList.add("text-in");

            setTimeout(function(){
                txts[index].classList.add("text-out");              
            },textOutTimer)

            setTimeout(function(){

              if(index == txtsLen-1){
                  index=0;
                }
               else{
                   index++;
                 }
                animateText();
            },textInTimer); 
         }
         
         window.onload=animateText;
   
}

